import Head from 'next/head';
import 'bootstrap/dist/css/bootstrap.min.css';

function HomePage() {
    return (
        <div>
            <Head>
                <title>
                    Home - Site Filipe
                </title>
                <meta name='description'
                    content='Site simples desenvolvido por filipe o qual utiliza React e Next'
                />
                <meta name='author'
                    content='Site simples desenvolvido por filipe o qual utiliza React e Next'
                />

            </Head>

            <Menu />
        Home
        </div>
    );
}

export default HomePage
